const ExecInstructions = (data) => // originally i(L)
{
    let arrayLength = Math.floor((data.length * 3) / 4); 
    let byteArray = new Uint8Array(arrayLength);
    var dataPos = 0;

    let base64 = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789-_';

    for (var pos = 0; dataPos < arrayLength; dataPos = dataPos + 4, pos = pos + 3)  // "pos" was "Ja"
    {
        let byte0 = base64.indexOf(data.charAt(dataPos));
        let byte1 = base64.indexOf(data.charAt(dataPos + 1));
        let byte2 = base64.indexOf(data.charAt(dataPos + 2));
        let byte3 = base64.indexOf(data.charAt(dataPos + 3));
       
        let byteArrayValue0 = (byte0 << 2) | (byte1 >> 4); // no better name for now
        let byteArrayValue1 = ((byte1 & 15) << 4) | (byte2 >> 2);
        let byteArrayValue2 = ((byte2 & 3) << 6) | byte3;

        byteArray[pos] = byteArrayValue0;

        if (dataPos + 2 < arrayLength)
        {
            byteArray[pos+1] = byteArrayValue1;
        }

        if (dataPos + 3 < arrayLength)
        {
            byteArray[pos+2] = byteArrayValue2;
        }
    }

    return byteArray;
};



